        snmp_set_var_value(&var_strModInfoIndex, (u_char *) &mib_idx->strModInfoIndex,
                           sizeof(mib_idx->strModInfoIndex));

        err = build_oid_noalloc(oid_idx->oids, oid_idx->len, &oid_idx->len,
                                NULL, 0, &var_strModIdnum);
